script: |
  super -f text -I q133.spq | sort > q133.out

inputs:
  - name: q133.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE - 80 / col0 BETWEEN ( col1 / - 17 * + 77 + - col2 + - col2 ) AND col2 * + col0;
  - name: tab0

outputs:
  - name: q133.out
    data: |
      15	81	47
      87	21	10
      97	1	99
